import React, { Component } from "react";

class SignIn extends Component {
    constructor(props) {
        super(props);

        props.method("admin", "admin");
    }

    render() {
        return (
            <div>
                <button
                    value="TEST"
                    onClick={() => {
                        this.props.method();
                    }}
                ></button>
            </div>
        );
    }
}

export default SignIn;
